import React, { Component } from "react";

class StoreCapability extends Component {
  render() {
    return (
      <div>
        <div class="card mb-3">
          <div class="card-body">
              <h3>Store Capabilities</h3>
              <ul className="list-items-inline">
                  <li>Store pickUp</li>
                  <li>Ship from Store</li>
                  <li>Ship To Store</li>
                  <li>Drive Up Delivery</li>
                  <li>scheduled delivery</li>
              </ul>
          </div>
        </div>
      </div>
    );
  }
}

export default StoreCapability;
